import React, { useState } from 'react';
import axios from 'axios';

const TimeTravelButton = () => {
  const [era, setEra] = useState('Ancient Rome');

  const handleTimeTravel = async (newEra) => {
    try {
      const response = await axios.get('http://localhost:5000/api/timeTravel', {
        params: { era: newEra },
      });
      setEra(response.data.era); // Change the current era
    } catch (error) {
      console.error('Error in time travel:', error);
    }
  };

  return (
    <div className="time-travel-container">
      <h3>Choose Your Era</h3>
      <button onClick={() => handleTimeTravel('Ancient Rome')}>Ancient Rome</button>
      <button onClick={() => handleTimeTravel('Medieval Europe')}>Medieval Europe</button>
      <button onClick={() => handleTimeTravel('Victorian England')}>Victorian England</button>
    </div>
  );
};

export default TimeTravelButton;
